  var roundTrip = JSON.parse(json);

  final frames = <String, TextureInput>{};

  roundTrip.forEach((String key, Map<String, Dynamic> value) {
    final parsed = new TextureInput.fromHash(key, value);
    frames[key] = parsed;
  });

  return frames;
}
